import { css } from "emotion";

const Styles = {
    UserBarStyle: css `
        border-top: 1px solid lightgrey;
    `,
    ProgressBarWrapperStyle: css `
        width: 50vw;
        position: absolute;
        right: 5vw;
    `,
    ProgressBarStyle: css `
        width: 37vw;
        float: right;
        margin-top: 1.35vh;
    `,
    LevelImage: css `
        width: 3vw;
    `
}

export default Styles;
